const emptyCaseData = {
    "case_name": "",
    "stage": [null, null, null],
    "clincial_stage": null,
    "case_staging_status": "Incomplete",
    "five_year_survival": null,
    "staging": {
        "T": {
            "depth": null,
            "ulceration": null,
            "more_than_08mm": false
        },
        "N": {
            "SLNB": null,
            "clinically_occult": 0,
            "lab_confirmed": 0,
            "MSI": false
        },
        "M": {
            "mets": false,
            "mets_location": null
        }
    }

}

export default emptyCaseData;
